import React from 'react';
import {
  Container,
  Grid,
  makeStyles
} from '@material-ui/core';
import Page from 'src/components/Page';
import TotalPatients from './TotalPatients';
import LatestOrders from './LatestOrders';
import LatestProducts from './LatestProducts';
import DiagnosesBarChart from './DiagnosesBarChart';
import TotalUniqueDiagnoses from './TotalUniqueDiagnoses';
import TotalAdmissions from './TotalAdmissions';
import FirstMostCommon from './FirstMostCommon';
import SecondMostCommon from './SecondMostCommon';
import TotalPrescriptions from './TotalPrescriptions';
import TotalUniquePrescriptions from './TotalUniquePrescriptions';
import TrafficByDevice from './TrafficByDevice';

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: theme.palette.background.dark,
    minHeight: '100%',
    paddingBottom: theme.spacing(3),
    paddingTop: theme.spacing(3)
  }
}));

const Dashboard = () => {
  const classes = useStyles();

  return (
    <Page
      className={classes.root}
      title="Dashboard"
    >
      <Container maxWidth={false}>
        <Grid
          container
          spacing={3}
        >
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
           <TotalPatients />
          </Grid>
          <Grid
            item
            lg={2}
            sm={3}
            xl={1}
            xs={15}
          >
           <TotalAdmissions />
          </Grid>
          <Grid
            item
            lg={2}
            sm={3}
            xl={1}
            xs={15}
          >
           <TotalUniqueDiagnoses />
          </Grid>
          <Grid
            item
            lg={2}
            sm={3}
            xl={1}
            xs={15}
          >
           <FirstMostCommon />
          </Grid>
          <Grid
            item
            lg={2}
            sm={3}
            xl={1}
            xs={15}
          >
           <SecondMostCommon />
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
          <TotalPrescriptions />
         </Grid>
         <Grid
           item
           lg={3}
           sm={6}
           xl={3}
           xs={12}
         >
         <TotalUniquePrescriptions />
        </Grid>
        <Grid
          item
          lg={3}
          sm={6}
          xl={3}
          xs={12}
        >
            <DiagnosesBarChart />
          </Grid>
          <Grid
            item
            lg={4}
            md={6}
            xl={3}
            xs={12}
          >
            {/* <TrafficByDevice />
          </Grid>
          <Grid
            item
            lg={4}
            md={6}
            xl={3}
            xs={12}
          > */}
            {/* <LatestProducts />
          </Grid>
          <Grid
            item
            lg={8}
            md={12}
            xl={9}
            xs={12}
          >
            <LatestOrders /> */}
          </Grid>
        </Grid>
      </Container>
    </Page>
  );
};

export default Dashboard;
